import React,{Component}from 'react';
import axios from 'axios';
import RequestRow from "../components/RequestRow.component"
import { Link } from 'react-router-dom';

export default class ArcitectPage extends Component{
    constructor(props){
        super(props);
        
        this.state={Requests:[]};
    }
    componentDidMount(){
      //${this.props.userID}
        axios.get(`http://localhost:3000/Request/Userid/${this.props.User._id}`)
        .then(res=>{console.log(res.data)
         this.setState({Requests:res.data.Req})})
        .catch(err=>{console.log('Error'+err)})
    }

    RequestsList(){
        return this.state.Requests.map( currentRequests=>{
            return(
            <RequestRow
            Status={currentRequests.status} ReqNumber={currentRequests._id}
            SVM={currentRequests.SVM}
            key={currentRequests._id}/>
            )})
    }
    render(){
        return(
        <div className="container-fluid d-flex justify-content-center">
            <div className="w-50">
                <p>Hello {this.props.User.username}</p>
                <Link to="/Requset" className="btn btn-primary">Request</Link>
            </div> 
            <div>
                <table className="table table-hover ">
                    <thead>
                        <tr className="table-info">
                            <th scope="col">Request Number</th>
                            <th scope="col">Svm</th>
                            <th scope="col">Status</th>
                        </tr>
                    </thead>
                    <tbody className="table-secondary">
                        {this.RequestsList()}
                    </tbody>
                </table>
            </div>
            
        </div>
        )
    }
}
